import react,{useState} from "react";
import './Style.css';
import axios from "axios";

function Enquir() {

  const [track,setTrack] = useState("");
  const [awb,setAwb] = useState("");
  const [courier,setCourier] = useState("");
  const [source,setSource] = useState("");
  const [destination,setDestination] = useState("");
  const [status,setStatus] = useState("");
  const [expected,setExpected] = useState("");
  

   const gett =(e) => {
     e.preventDefault();
     axios.post('http://localhost:4000/track',{
          track: track

        })
        console.log("cliekd")
        alert("Successfully Submitted");
   }
  
  
  
  
  
  
  const search =(e)=> {
     e.preventDefault();
    axios.get('http://localhost:4000/access')
    .then(res => {
      var i=0;
      for(i=0;i<res.data.length;i++) {
      if(res.data[i].AWB_No==track)
      {
        setAwb(res.data[i].AWB_No);
        setcourier(res.data[i].Courier_Name);
        setSource(res.data[i].Source);
        setDestination(res.data[i].Destination);
        setStatus(res.data[i].Status);
        setExpected(res.data[i].Expected_Delivery);

        console.log(res.data[i].Expected_Delivery)





      }
      
      
      }

      console.log(res)
    
      
      console.log(track)
     
      console.log(res.data.length)
    }).catch(err => {
      console.log(err)
    })

  }
  







  return (
    <>
       <header>
    <div className="wrapper">

        <img src="Logo.png" className="logo" />
        <nav className="navbar">
            
            <a href="#">Home </a>
            <a href="#">Products </a>
            <a href="#">Contactus </a>
            <a href="#">Aboutus </a>
            
        </nav>

        
        <button className="btn2"> LOGIN</button>
        <button className="btn">ENQUIRY</button>
    </div>
</header>

<div className="log">

        
    
        <div className="formleft"> 
             <h1>Track your Order</h1><br/>

                  <form onSubmit={(e)=>search(e)} >
                    
                    
                         <span className="head">Enter AWB / Shipment No </span>
                             <input type="name"placeholder="AWB / Shipment No"value={track} onChange={(e) => setTrack(e.target.value)} className="tfield" />
                             <button type="submit" className="tbutton" >Track</button>
                   

                  </form>
                  
                  
                  <h1>hello</h1>
            
        </div>

       

      
    </div>

    </>
  )
}
export default Enquir;
